const addIDEResponse = (ide_id, id) => {
  // prettyCode(ide[ide_id].response[id]);
  // $(".jsIDE .ide-input").append(prettyCode(ide[ide_id].response[id]) + "<br>");
  $(".jsIDE .ide-input").append(ide[ide_id].response[id] + "<br>");
};
const addOutputResponse = (ide_id, id) => {
  $(".jsIDE .ide-output").append(ide_output[ide_id].response[id] + "<br>");
};

const clearIdeOutput = () => {
  $(".jsIDE .ide-output").empty();
};
const clearIdeInput = () => {
  $(".jsIDE .ide-input").empty();
};

// $(".hide").removeClass("hide");
// var ide_id = 0;
// var ide_output_id = 0;

const updateIdeResponse = () => {
  $("html, body").animate(
    {
      scrollTop: $(".jsIDE .ide-input").offset().top - 100,
    },
    0
  );
  // console.log("ide");

  var id = 0;
  var timer = setInterval(() => {
    // console.log(ide_id, id);
    ide[ide_id].response.length != 0 ? addIDEResponse(ide_id, id) : null;
    $(".jsIDE .ide-input")[0].scrollTop = $(".jsIDE .ide-input")[0].scrollHeight;
    $("html, body").animate(
      {
        scrollTop: $(".jsIDE .ide-input").offset().top + $(".jsIDE .ide-input").height(),
      },
      10
    );
    id += 1;
    if (id > ide[ide_id].response.length - 1) {
      ide_id += 1;
      if ((ide_id < 14 || ide_id > 18) && ide_id != 4 && ide_id != 6) enableRunButton();
      console.log("it increaed", ide_id);
      clearInterval(timer);
    }
  }, 100);
};

const updateIdeOutput = (showContinueButton) => {
  disableRunButton();
  var id = 0;
  var timer = setInterval(() => {
    // console.log(ide_id, ide_output_id);
    // console.log(ide_output[ide_output_id].response);
    // ide_output[ide_output_id].response.length != 0 ? addOutputResponse(ide_output_id, id) : console.log(ide_output[ide_output_id].response.length);
    ide_output[ide_output_id].response.length != 0 ? addOutputResponse(ide_output_id, id) : console.log("no output left");
    $(".jsIDE .ide-output")[0].scrollTop = $(".jsIDE .ide-output")[0].scrollHeight;

    id += 1;
    if (id > ide_output[ide_output_id].response.length - 1) {
      ide_output_id += 1;

      if (showContinueButton) {
        $(".jsContinue").removeClass("hide");
        // $(".jsContinue").off("click");

        // $(".jsContinue").click(nextPreTrainedModelStep);
      }

      clearInterval(timer);
    }
  }, 100);
};

