$(".jsRunButton").click((e) => {
  $(".jsIDEOutput").removeClass("hide");
  $(".jsCorrectModuleFeedback").addClass("hide");

  if (ide_id == 9) {
    $(".jsLoadLabels").addClass("hide");
    updateActivityText();
  } else if (ide_id == 10) {
    $(".jsLoadPreTrainedModel").addClass("hide");
  } else if (ide_id == 12) {
    updateActivityText();
  } else if (ide_id == 13) {
    // updateActivityText();
    $(".jsActivity").addClass("hide");

    $(".jsIDE").addClass("hide");
    $(".jsStory2").removeClass("hide");

    $("body").addClass("traffic-animation--red-boxes");

    updateTextStory_2();
  }
  if (ide_id != 13) {
    $("html, body").animate(
      {
        scrollTop: $(".jsIDEOutput").offset().top + $(".jsIDEOutput").height(),
      },
      10
    );
    setTimeout(() => {
      updateIdeOutput(true);
    }, 100);
  } else clearIdeInput();
});

